import base64, urllib.parse, requests
import imghdr, io

# 1️⃣  Pega aquí tu cadena COMPLETA tal cual la recibes
svg_data = """
data:image/svg+xml;base64,
"""  #  ←  pon TODO el texto; si es larguísimo usa triple comillas como aquí

# 2️⃣  A partir de aquí el código de conversión
raw_b64  = svg_data.replace("data:image/svg+xml;base64,", "")
svg_xml  = base64.b64decode(raw_b64).decode("utf-8")
url      = "https://raster.shields.io/png?raw=true&uri=" + urllib.parse.quote(svg_xml)

png      = requests.get(url, timeout=20).content   # bytes PNG
png_b64  = base64.b64encode(png).decode()

print("PNG en Base64:", png_b64)   

kind = imghdr.what(None, h=base64.b64decode("""
                                            
                                            """))
print("Tipo detectado:", kind)    